import axios from "axios";

export const fetchMe = async () => {
  const res = await axios.get(
    "http://localhost:3001/api/me",
    {
      withCredentials: true,
      validateStatus: (status) => {
        return status === 200 || status === 401;
      },
    }
  );

  if (res.status === 401) {
    return null; // user not logged in
  }

  return res.data;
};
